import { ResponsiveBar } from '@nivo/bar'

// make sure parent container have a defined height when using
// responsive component, otherwise height will be 0 and
// no chart will be rendered.
// website examples showcase many properties,
// you'll often use just a few of them.


const data = [
    {
      "country": "AD",
      "hot dog": 7,
      "hot dogColor": "hsl(46, 70%, 50%)",
      "burger": 142,
      "burgerColor": "hsl(289, 70%, 50%)",
      "sandwich": 132,
      "sandwichColor": "hsl(168, 70%, 50%)",
      "kebab": 28,
      "kebabColor": "hsl(18, 70%, 50%)",
      "fries": 181,
      "friesColor": "hsl(53, 70%, 50%)",
      "donut": 108,
      "donutColor": "hsl(273, 70%, 50%)"
    },
    {
      "country": "AE",
      "hot dog": 80,
      "hot dogColor": "hsl(211, 70%, 50%)",
      "burger": 98,
      "burgerColor": "hsl(289, 70%, 50%)",
      "sandwich": 199,
      "sandwichColor": "hsl(206, 70%, 50%)",
      "kebab": 148,
      "kebabColor": "hsl(313, 70%, 50%)",
      "fries": 44,
      "friesColor": "hsl(215, 70%, 50%)",
      "donut": 14,
      "donutColor": "hsl(115, 70%, 50%)"
    },
    {
      "country": "AF",
      "hot dog": 48,
      "hot dogColor": "hsl(355, 70%, 50%)",
      "burger": 24,
      "burgerColor": "hsl(234, 70%, 50%)",
      "sandwich": 103,
      "sandwichColor": "hsl(33, 70%, 50%)",
      "kebab": 190,
      "kebabColor": "hsl(133, 70%, 50%)",
      "fries": 9,
      "friesColor": "hsl(331, 70%, 50%)",
      "donut": 155,
      "donutColor": "hsl(194, 70%, 50%)"
    },
    {
      "country": "AG",
      "hot dog": 28,
      "hot dogColor": "hsl(244, 70%, 50%)",
      "burger": 87,
      "burgerColor": "hsl(218, 70%, 50%)",
      "sandwich": 147,
      "sandwichColor": "hsl(107, 70%, 50%)",
      "kebab": 2,
      "kebabColor": "hsl(16, 70%, 50%)",
      "fries": 33,
      "friesColor": "hsl(20, 70%, 50%)",
      "donut": 176,
      "donutColor": "hsl(310, 70%, 50%)"
    },
    {
      "country": "AI",
      "hot dog": 73,
      "hot dogColor": "hsl(41, 70%, 50%)",
      "burger": 32,
      "burgerColor": "hsl(251, 70%, 50%)",
      "sandwich": 170,
      "sandwichColor": "hsl(175, 70%, 50%)",
      "kebab": 69,
      "kebabColor": "hsl(7, 70%, 50%)",
      "fries": 54,
      "friesColor": "hsl(22, 70%, 50%)",
      "donut": 151,
      "donutColor": "hsl(84, 70%, 50%)"
    },
    {
      "country": "AL",
      "hot dog": 162,
      "hot dogColor": "hsl(241, 70%, 50%)",
      "burger": 100,
      "burgerColor": "hsl(157, 70%, 50%)",
      "sandwich": 99,
      "sandwichColor": "hsl(242, 70%, 50%)",
      "kebab": 153,
      "kebabColor": "hsl(248, 70%, 50%)",
      "fries": 98,
      "friesColor": "hsl(44, 70%, 50%)",
      "donut": 116,
      "donutColor": "hsl(290, 70%, 50%)"
    },
    {
      "country": "AM",
      "hot dog": 14,
      "hot dogColor": "hsl(216, 70%, 50%)",
      "burger": 191,
      "burgerColor": "hsl(286, 70%, 50%)",
      "sandwich": 144,
      "sandwichColor": "hsl(332, 70%, 50%)",
      "kebab": 179,
      "kebabColor": "hsl(74, 70%, 50%)",
      "fries": 129,
      "friesColor": "hsl(321, 70%, 50%)",
      "donut": 156,
      "donutColor": "hsl(167, 70%, 50%)"
    }
  ]


const Barchartt = () => {
    return(
    <ResponsiveBar
        data={data}
        keys={[
            'hot dog',
            'burger',
            'sandwich',
        ]}
        indexBy="country"
        margin={{ top: 50, right: 130, bottom: 50, left: 60 }}
        padding={0.3}
        valueScale={{ type: 'linear' }}
        indexScale={{ type: 'band', round: true }}
        colors={{ scheme: 'nivo' }}
        defs={[
            {
                id: 'dots',
                type: 'patternDots',
                background: 'inherit',
                color: '#38bcb2',
                size: 4,
                padding: 1,
                stagger: true
            },
            {
                id: 'lines',
                type: 'patternLines',
                background: 'inherit',
                color: '#eed312',
                rotation: -45,
                lineWidth: 6,
                spacing: 10
            }
        ]}
        fill={[
            {
                match: {
                    id: 'fries'
                },
                id: 'dots'
            },
            {
                match: {
                    id: 'sandwich'
                },
                id: 'lines'
            }
        ]}
        borderColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        axisTop={null}
        axisRight={null}
        axisBottom={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'country',
            legendPosition: 'middle',
            legendOffset: 32
        }}
        axisLeft={{
            tickSize: 5,
            tickPadding: 5,
            tickRotation: 0,
            legend: 'food',
            legendPosition: 'middle',
            legendOffset: -40
        }}
        labelSkipWidth={12}
        labelSkipHeight={12}
        labelTextColor={{
            from: 'color',
            modifiers: [
                [
                    'darker',
                    1.6
                ]
            ]
        }}
        legends={[
            {
                dataFrom: 'keys',
                anchor: 'bottom-right',
                direction: 'column',
                justify: false,
                translateX: 120,
                translateY: 0,
                itemsSpacing: 2,
                itemWidth: 100,
                itemHeight: 20,
                itemDirection: 'left-to-right',
                itemOpacity: 0.85,
                symbolSize: 20,
                effects: [
                    {
                        on: 'hover',
                        style: {
                            itemOpacity: 1
                        }
                    }
                ]
            }
        ]}
        role="application"
        ariaLabel="Nivo bar chart demo"
        barAriaLabel={function(e){return e.id+": "+e.formattedValue+" in country: "+e.indexValue}}
    />
)

    }

export default Barchartt
